local function Command(Cmd)
	if StringsLowerMessage then
		return Arg1 == Prefix..(string.lower(Cmd))
	else
		return Arg1 == Prefix..Cmd
	end
end

local function PrefixCommand(Cmd)
	if StringsLowerMessage then
		return Arg1 == "!"..string.lower(Cmd)
	else
		return Arg1 == "!"..Cmd
	end
end

